import * as React from "react";
import "./mock";
import * as Ant from "antd";

function App() {
  const [datasource, setDataSource] = React.useState();
  const [isLoading, setIsLoading] = React.useState(true);

  React.useEffect(() => {
    fetch("/api/properties")
      .then(res => res.json())
      .then(
        (result) => {
          console.log(result);
          setDataSource(result);
          setIsLoading(false);
        },
        (error) => {
          console.log(error);
          setIsLoading(false);
        }
      )
  }, []);


  return (
    <Ant.Table dataSource columns/>
  );
}


export default App;
